schemaDefinition: "create or replace view U_ST_ACCOUNT(\n\t\"AccountSysID\",\n\t\"\
  AccountEndDate\",\n\t\"AccountDirectAssignment\",\n\t\"AccountOwnerName\",\n\t\"\
  AccountActive\",\n\t\"AccountJobFunctionSysID\",\n\t\"AccountOwnerSysID\",\n\t\"\
  SalesTeamAccountName\",\n\t\"AccountJobFunctionName\",\n\t\"AccountPrimaryAssignment\"\
  ,\n\t\"AccountStartDate\",\n\t\"SysCreatedBy\",\n\t\"SysCreatedOn\"\n) as -- SEMANTIC\
  \ LAYER BEGINS\n\nSELECT DISTINCT \"U_REC_SYS_ID\" as \"AccountSysID\",\n      \
  \          \"U_END_DATE\" as \"AccountEndDate\",\n                \"U_DIRECT_ASSIGNMENT\"\
  \ as \"AccountDirectAssignment\",\n                \"DV_U_USER\" as \"AccountOwnerName\"\
  ,\n                \"U_ACTIVE\" as \"AccountActive\",\n                \"U_JOB_FUNCTION\"\
  \ as \"AccountJobFunctionSysID\",\n                \"U_USER\" as \"AccountOwnerSysID\"\
  ,\n                \"DV_U_REC_SYS_ID\" as \"SalesTeamAccountName\",\n          \
  \      \"DV_U_JOB_FUNCTION\" as \"AccountJobFunctionName\",\n                \"\
  U_PRIMARY_ASSIGNMENT\" as \"AccountPrimaryAssignment\",\n                \"U_START_DATE\"\
  \ as \"AccountStartDate\",\n                \"SYS_CREATED_BY\" as \"SysCreatedBy\"\
  ,\n                \"SYS_CREATED_ON\" as \"SysCreatedOn\"\nFROM \"RDS\".\"SURF\"\
  .\"U_ST_ACCOUNT\";"
